def gcd(a,b):
    while b != 0:
        t = b
        b = a % b
        a = t
    return a


def factorize(n):
    base = [2, 3, 5, 7, 11, 13, 17, 19, 23];

    start = int(sqrt(n))

    factors = []
    pairs = []
    i = start
    while i < n: #for i in xrange(start, n):
        j, end = 0, len(base)
        while j < end: #for j in xrange(len(base)):
            lhs = i**2 % n
            rhs = base[j]**2 % n

            if lhs == rhs:
                f = gcd(i - base[j], n)
                if f != 1:
                   factors.append(long(f))
            j += 1
        i += 1

    return set(factors)

